import React, { PureComponent } from 'react';
import "./right.css";
import Event from "./Even.js"

export default class EmergencyCommandChartRight extends PureComponent {
    render() {
        return (
            <div className="right">
				<div className="chart-title">应急事件管理</div>
				<Event></Event>
            </div>
        );
    }
}
